contracts/ProcurementLog.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";

contract ProcurementLog is AccessControl, Pausable {
    bytes32 public constant GPO_ROLE = keccak256("GPO_ROLE");
    bytes32 public constant VENDOR_ROLE = keccak256("VENDOR_ROLE");

    // Event structs
    struct RfpData {
        string rfpId;
        string title;
        uint256 budget;
        uint256 submissionDeadline;
        string createdBy;
    }

    struct BidData {
        string bidId;
        string rfpId;
        string vendorId;
        uint256 submissionDate;
        bytes32 proposalHash;
    }

    struct ContractData {
        string contractId;
        string rfpId;
        string vendorId;
        string bidId;
        uint256 awardDate;
        uint256 totalValue;
        uint256 startDate;
        uint256 endDate;
    }

    struct MilestoneData {
        string milestoneId;
        string contractId;
        string title;
        uint256 dueDate;
        string status;
        string updatedBy;
        bytes32 detailsHash;
    }

    // Events
    event RfpCreated(RfpData data);
    event RfpPublished(string rfpId, uint256 publishDate, uint256 numberOfBidsAllowed);
    event BidSubmitted(BidData data);
    event BidEvaluated(string bidId, string rfpId, uint256 evaluationScore, uint256 evaluationDate, bytes32 evaluationHash);
    event ContractAwarded(ContractData data);
    event MilestoneCreated(MilestoneData data);
    event MilestoneUpdated(MilestoneData data);

    constructor() {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    // Modifiers
    modifier onlyGPO() {
        require(hasRole(GPO_ROLE, msg.sender), "Caller is not a GPO");
        _;
    }

    modifier onlyVendor() {
        require(hasRole(VENDOR_ROLE, msg.sender), "Caller is not a vendor");
        _;
    }

    // RFP Functions
    function logRfpCreation(
        string memory rfpId,
        string memory title,
        uint256 budget,
        uint256 submissionDeadline,
        string memory createdBy
    ) public onlyGPO whenNotPaused {
        emit RfpCreated(RfpData(
            rfpId,
            title,
            budget,
            submissionDeadline,
            createdBy
        ));
    }

    function logRfpPublication(
        string memory rfpId,
        uint256 numberOfBidsAllowed
    ) public onlyGPO whenNotPaused {
        emit RfpPublished(rfpId, block.timestamp, numberOfBidsAllowed);
    }

    // Bid Functions
    function logBidSubmission(
        string memory bidId,
        string memory rfpId,
        string memory vendorId,
        bytes32 proposalHash
    ) public onlyVendor whenNotPaused {
        emit BidSubmitted(BidData(
            bidId,
            rfpId,
            vendorId,
            block.timestamp,
            proposalHash
        ));
    }

    function logBidEvaluation(
        string memory bidId,
        string memory rfpId,
        uint256 evaluationScore,
        bytes32 evaluationHash
    ) public onlyGPO whenNotPaused {
        emit BidEvaluated(
            bidId,
            rfpId,
            evaluationScore,
            block.timestamp,
            evaluationHash
        );
    }

    // Contract Functions
    function logContractAward(
        string memory contractId,
        string memory rfpId,
        string memory vendorId,
        string memory bidId,
        uint256 totalValue,
        uint256 startDate,
        uint256 endDate
    ) public onlyGPO whenNotPaused {
        emit ContractAwarded(ContractData(
            contractId,
            rfpId,
            vendorId,
            bidId,
            block.timestamp,
            totalValue,
            startDate,
            endDate
        ));
    }

    // Milestone Functions
    function logMilestoneCreation(
        string memory milestoneId,
        string memory contractId,
        string memory title,
        uint256 dueDate,
        string memory status,
        string memory updatedBy,
        bytes32 detailsHash
    ) public onlyGPO whenNotPaused {
        emit MilestoneCreated(MilestoneData(
            milestoneId,
            contractId,
            title,
            dueDate,
            status,
            updatedBy,
            detailsHash
        ));
    }

    function logMilestoneUpdate(
        string memory milestoneId,
        string memory contractId,
        string memory title,
        uint256 dueDate,
        string memory status,
        string memory updatedBy,
        bytes32 detailsHash
    ) public whenNotPaused {
        require(
            hasRole(GPO_ROLE, msg.sender) || hasRole(VENDOR_ROLE, msg.sender),
            "Caller must be GPO or vendor"
        );

        emit MilestoneUpdated(MilestoneData(
            milestoneId,
            contractId,
            title,
            dueDate,
            status,
            updatedBy,
            detailsHash
        ));
    }

    // Role management
    function addGPO(address account) public onlyRole(DEFAULT_ADMIN_ROLE) {
        grantRole(GPO_ROLE, account);
    }

    function addVendor(address account) public onlyRole(DEFAULT_ADMIN_ROLE) {
        grantRole(VENDOR_ROLE, account);
    }

    // Circuit breaker
    function pause() public onlyRole(DEFAULT_ADMIN_ROLE) {
        _pause();
    }

    function unpause() public onlyRole(DEFAULT_ADMIN_ROLE) {
        _unpause();
    }
}

